Водохрани́лище — искусственный (рукотворный) водоём, образованный, как правило, в долине реки водоподпорными сооружениями для накопления и хранения воды в целях её использования в народном хозяйстве. Водохранилища делятся на два вида: 
*  озёрные; 
*  речные (русловые). Для водохранилищ озёрного вида (например, Рыбинского) характерно формирование водных масс, существенно отличных по своим физическим свойствам от свойств вод притоков. Течения в этих водохранилищах связаны больше всего с ветрами. Водохранилища речного (руслового) вида (например, Дубоссарское) имеют вытянутую форму, течения в них, обычно, стоковые; водная масса по своим характеристикам близка к речным водам. Основными параметрами водохранилища являются объём, площадь зеркала и амплитуда колебания уровней воды в условиях его эксплуатации.
